import * as o from "react";
import r from "../lib/IconBase.es.js";
import t from "../defs/Scan.es.js";
const a = o.forwardRef((c, e) => /* @__PURE__ */ o.createElement(r, { ref: e, ...c, weights: t }));
a.displayName = "ScanIcon";
const s = a;
export {
  s as Scan,
  a as ScanIcon
};
